import React from 'react';
import logo from '../Assets/logo_boat.jpg'
 

const NavBar = () => {
    return (
        <div className='navBar'>
            <a href="/" className="site-logo"><img src={logo} /> </a>
        </ div>
    );
}

export default NavBar;
